import './App.css';
import SignIn from './components/auth/AuthPage';
import NavAppBar from './components/Header/Header';
import Grid from "@mui/material/Grid";




function App() {
  return (
      <Grid container justifyContent="center">

          <NavAppBar/>

          <div className="App">
              <SignIn/>
          </div>
      </Grid>
  );
}



export default App;
